import React from 'react';
import TextField from './components/TextField/TextField';
import TextFieldDemo from './pages/TextFieldDemo/TextFieldDemo';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TextField />
        <TextFieldDemo />
      </header>
    </div>
  );
}

export default App;
